import {IUser} from "../../components/register/IUser";

export const REGISTER_USER : string = 'REGISTER_USER';


export interface ActionType {
    type : string;
    payload :{
        user :IUser
    }
}

export const registerUser = (user:IUser) =>{
    return{
        type:REGISTER_USER,
        payload:{
            user:user
        }
    }
};
